import Menu from '../Menu';
import Footer from '../Footer';
import styled from 'styled-components';

const Main = styled.main`
    background-color: var(--black);
    color: var (--)
`;

function PageDefault({children}){
    return(
        <div>
        <Menu/>
            <Main>
                {children}
            </Main>
        <Footer/>
        </div>
    );
}

export default PageDefault;
